class SearchData {
  SearchData({
      this.posts,});

  SearchData.fromJson(dynamic json) {
    if (json['posts'] != null) {
      posts = [];
      json['posts'].forEach((v) {
        posts?.add(SearchPosts.fromJson(v));
      });
    }
  }
  List<SearchPosts>? posts;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    if (posts != null) {
      map['posts'] = posts?.map((v) => v.toJson()).toList();
    }
    return map;
  }

}